const zigbeeHerdsmanConverters = require('zigbee-herdsman-converters');

const exposes = zigbeeHerdsmanConverters.exposes;
const ea = exposes.access;
const e = exposes.presets;
const fz = zigbeeHerdsmanConverters.fromZigbeeConverters;
const tz = zigbeeHerdsmanConverters.toZigbeeConverters;

const ptvo_switch = zigbeeHerdsmanConverters.findByDevice({modelID: 'ptvo.switch'});
fz.legacy = ptvo_switch.meta.tuyaThermostatPreset;

const device = {
    zigbeeModel: ['ptvo_switch_3ch'],
    model: 'ptvo_switch_3ch',
    vendor: 'Custom devices (DiY)',
    description: '[3-channel wall switch by modkam.ru & ptvo.info](https://modkam.ru/?p=2031)',
    fromZigbee: [fz.ignore_basic_report, fz.battery, fz.on_off, fz.ptvo_multistate_action, fz.legacy.ptvo_switch_buttons,],
    toZigbee: [tz.ptvo_switch_trigger, tz.on_off,],
    exposes: [e.battery(),
      e.switch().withEndpoint('l2'),
      e.action(['single', 'double', 'triple', 'hold', 'release']),
      e.battery_voltage(),
],
    meta: {
        multiEndpoint: true,
        
    },
    endpoint: (device) => {
        return {
            l2: 2, l3: 3, l4: 4,
        };
    },
    icon: 'data:image/png;base64,',
};

module.exports = device;
